import React from "react";
import './SearchPopup.css';

const SearchPopup = () => {
    return (
        <div className="searchPopup">
            <h1>search</h1>
            <div className="searchItem">
              <label>Destination</label>
              <input placeholder type="text" />
            </div>
            <div className="searchItem">
              <label>Check-in Date</label>
              <input placeholder="" type="text" />
            </div>
        </div>
    );
}

export default SearchPopup;
